// src/components/Login.js
import React, { useState } from 'react';
import axios from 'axios';
import { jwtDecode } from 'jwt-decode';
import { useNavigate } from 'react-router-dom';
import jwt_decode from 'jwt-decode'; // For decoding the JWT token

const Login = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [credentials, setCredentials] = useState({
    username: '',
    password: '',
  });
  const [error, setError] = useState('');
  const navigate = useNavigate(); // Initialize navigate

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setCredentials({ ...credentials, [name]: value });
  };

  const handleLogin = async (e) => {
    e.preventDefault();
    const endpoint = isAdmin ? '/api/admin/login/' : '/api/user/login/';
    try {
      const response = await axios.post(endpoint, credentials);
      const { access, refresh } = response.data; // Assuming API returns access and refresh tokens

      // Store the tokens in sessionStorage or localStorage
      sessionStorage.setItem('access_token', access);
      sessionStorage.setItem('refresh_token', refresh);

      // Decode the token to extract user information if needed
      const user = jwtDecode(access);
      const userType = user.user_type; // Assuming the token contains user_type

      // Set the Authorization header for future requests
      axios.defaults.headers.common['Authorization'] = `Bearer ${access}`;

      // Redirect based on user type
      if (isAdmin || userType === 'admin') {
        navigate('/admin/dashboard'); // Redirect admin to dashboard
      } else {
        navigate('/user/dashboard');  // Redirect user to user dashboard
      }
    } catch (error) {
      // Improved error handling
      if (error.response) {
        // Client received an error response (5xx, 4xx)
        if (error.response.status === 400) {
          setError('Invalid username or password.');
        } else if (error.response.status === 401) {
          setError('Unauthorized. Please check your credentials.');
        } else {
          setError('Login failed. Please try again.');
        }
      } else if (error.request) {
        // Client never received a response, or request never left
        setError('No response from the server. Please check your network connection.');
      } else {
        // Anything else
        setError('An unknown error occurred.');
      }
    }
  };

  // Inline CSS styles
  const styles = {
    container: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      backgroundColor: '#f4f4f4',
    },
    form: {
      background: '#fff',
      padding: '20px',
      borderRadius: '5px',
      boxShadow: '0 2px 5px rgba(0,0,0,0.2)',
      width: '300px',
      textAlign: 'center',
    },
    label: {
      display: 'block',
      marginBottom: '8px',
      fontWeight: 'bold',
    },
    input: {
      width: '100%',
      padding: '10px',
      marginBottom: '15px',
      border: '1px solid #ccc',
      borderRadius: '4px',
    },
    button: {
      width: '100%',
      padding: '10px',
      backgroundColor: '#007BFF',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
      fontWeight: 'bold',
    },
    switchButton: {
      marginTop: '10px',
      padding: '10px',
      backgroundColor: '#6c757d',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
      fontWeight: 'bold',
    },
    error: {
      color: 'red',
      marginTop: '10px',
    },
  };

  return (
    <div style={styles.container}>
      <h2>{isAdmin ? 'Admin Login' : 'User Login'}</h2>
      <form style={styles.form} onSubmit={handleLogin}>
        <div>
          <label style={styles.label}>
            Username:
            <input
              type="text"
              name="username"
              value={credentials.username}
              onChange={handleInputChange}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Password:
            <input
              type="password"
              name="password"
              value={credentials.password}
              onChange={handleInputChange}
              required
              style={styles.input}
            />
          </label>
        </div>
        <button type="submit" style={styles.button}>Login</button>
      </form>
      <button style={styles.switchButton} onClick={() => setIsAdmin(!isAdmin)}>
        Switch to {isAdmin ? 'User' : 'Admin'} Login
      </button>
      {error && <div style={styles.error}>{error}</div>}
    </div>
  );
};

export default Login;
